const BookList = ({ books }) => {
    const bookItems = books.map(function(book) {
      return (
        React.createElement('div', { key: book.id, className: 'book-item' }, [
          React.createElement('img', { 
            src: book.coverPhotoURL,
            alt: book.title,
            style: { maxWidth: '100%', height: 'auto' }
          }),
          React.createElement('Typography', { variant: 'subtitle1', key: 'title' }, book.title),
          React.createElement('Typography', { variant: 'body2', color: 'textSecondary', key: 'author' }, book.author)
        ])
      );
    });

    return React.createElement('div', { className: 'book-list' }, bookItems);
  };
